import "./CreateCliente.css";
import React, { useState } from "react";
import TextField from '@mui/material/TextField';
import axios from "axios";
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import { useNavigate } from 'react-router-dom';

const CreateCliente = () => {

  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    login: '',
    senha: '',
    nome: '',
    cpf: '',
    email: '',
    estado: '',
    dataDeNascimento: '',
    cidade: '',
    cep: '',
  });

  const handleChange = (campo) => (event) => {
    setFormData({ ...formData, [campo]: event.target.value });
  };

  const salvar = async () => {
    try {
      const response = await axios.post('http://localhost:8080/api/cliente', formData);
      console.log(response);
    } catch (error) {
      console.log(error.response);
    }
    console.log('request finished');
  };

  const cancel = () => {
    console.log('cancel');
  };

  const goToAdvogado = () => {
    navigate("/sessao/createAdvogado");
  }

  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-12">
          <div className="bs-component">
            <div style={{ marginTop: '70px' }}>
              <ButtonGroup variant="contained" aria-label="Basic button group">
                <Button style={{ backgroundColor: 'grey' }}>Cliente</Button>
                <Button style={{ backgroundColor: 'white', color: 'grey' }} onClick={goToAdvogado}>Advogado</Button>
                <Button style={{ backgroundColor: 'white', color: 'grey' }}>Associado</Button>
              </ButtonGroup>
              <div className="form-container">
                <div className="form-title">Dados</div>
                <div className="form-content">
                  <div className="form-group">
                    <div className="form-label">NOME</div>
                    <TextField
                      hiddenLabel
                      id="filled-hidden-label-small"
                      defaultValue=""
                      variant="filled"
                      size="small"
                      className="form-input"
                      value={formData.nome}
                      onChange={handleChange('nome')}
                    />
                  </div>
                  <div className="form-group">
                    <div className="form-label">CPF/CNPJ</div>
                    <TextField
                      hiddenLabel
                      id="filled-hidden-label-small"
                      defaultValue=""
                      variant="filled"
                      size="small"
                      className="form-input"
                      value={formData.cpf}
                      onChange={handleChange('cpf')}
                    />
                  </div>
                  <div className="form-group">
                    <div className="form-label">TELEFONE</div>
                    <TextField
                      hiddenLabel
                      id="filled-hidden-label-small"
                      defaultValue=""
                      variant="filled"
                      size="small"
                      className="form-input"
                      value={formData.senha}
                      onChange={handleChange('senha')}
                    />
                  </div>
                  <div className="form-group">
                    <div className="form-label">EMAIL</div>
                    <TextField
                      hiddenLabel
                      id="filled-hidden-label-small"
                      defaultValue=""
                      variant="filled"
                      size="small"
                      className="form-input"
                      value={formData.email}
                      onChange={handleChange('email')}
                    />
                  </div>
                  <div className="form-group">
                    <div className="form-label">ESTADO</div>
                    <TextField
                      hiddenLabel
                      id="filled-hidden-label-small"
                      defaultValue=""
                      variant="filled"
                      size="small"
                      className="form-input"
                      value={formData.estado}
                      onChange={handleChange('estado')}
                    />
                  </div>
                  <div className="form-group">
                    <div className="form-label">CIDADE</div>
                    <TextField
                      hiddenLabel
                      id="filled-hidden-label-small"
                      defaultValue=""
                      variant="filled"
                      size="small"
                      className="form-input"
                      value={formData.cidade}
                      onChange={handleChange('cidade')}
                    />
                  </div>
                  <div className="form-group">
                    <div className="form-label">CEP</div>
                    <TextField
                      hiddenLabel
                      id="filled-hidden-label-small"
                      defaultValue=""
                      variant="filled"
                      size="small"
                      className="form-input"
                      value={formData.cep}
                      onChange={handleChange('cep')}
                    />
                  </div>
                </div>
                <div className="form-actions">
                  <Button onClick={cancel} variant="contained" style={{ width: 120, height: 40, backgroundColor: 'grey' }}>Cancelar</Button>
                  <Button onClick={salvar} variant="contained" style={{ width: 120, height: 40, backgroundColor: 'grey', marginLeft: '20px' }}>Salvar</Button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CreateCliente;
